/**
  * Returns true for functions, false otherwise.
  *
  * @example
  * utils.isFunction(() => {});// true
  * utils.isFunction(async () => {});// true
  * utils.isFunction('');// false
  *
  * @param  {any} value
  * @return {boolean}
  */
declare const _default: (value: any) => boolean;
export default _default;
